Rules.InvariantScript:
If(
    _comp_number_page = 1,
    FirstN(
        comp_table1_v01.Items_Table,
        Dropdown1_39.Selected.Value
    ),
    // 현재 페이지가 마지막 페이지인 경우
    // 또는 현재 페이지가 1페이지가 아니면서 마지막 페이지도 아닌 경우 (중간 페이지)
    If(
        _comp_number_page = _comp_num_last_page,
        // 마지막 페이지: 전체 항목 수에서 (페이지당 행 수 * (마지막 페이지 - 1)) 만큼 뺀 개수만큼만 가져옴
        LastN(
            comp_table1_v01.Items_Table,
            CountRows(comp_table1_v01.Items_Table) - (Dropdown1_39.Selected.Value * (_comp_number_page - 1))
        ),
        // 중간 페이지: 기존 로직과 동일 (페이지당 Dropdown1_39.Selected.Value 개수만큼 가져옴)
        LastN(
            FirstN(
                comp_table1_v01.Items_Table,
                Dropdown1_39.Selected.Value * _comp_number_page
            ),
            Dropdown1_39.Selected.Value
        )
    )
)


//_col_paginated

If(     _comp_selected_item.ID = ThisItem.ID ,
    Set( _comp_selected_item , Blank() );
    
    , 
    Set( _comp_selected_item , ThisItem );
    
);

comp_table1_v01.OnSelect_Item() ;

Set(
    _comp_number_page,
    1
);
Set(
    _comp_num_last_page,
    IfError(
        RoundUp(
            IfError(
            CountRows(comp_table1_v01.Items_Table) /Self.Selected.Value,0),
            0
        ),
        0
    )
) ; 
