Set(_col_paginated,
   ForAll(
        Sequence(
            CountRows(_col_paginated)
        ),
        Patch( 
            Last(
                FirstN(
                _col_paginated,
                Value)
            )
            ,
            {
                No:Text( If( _comp_number_page = 1 ,Value, (_comp_number_page-1)*Dropdown1_39.Selected.Value+Value) , "00")
            }
        )
    ) 
);

If( ThisItem.Value = 1 , Set( _comp_number_page , 1  ) ,
If( ThisItem.Value = 3 , Set( _comp_number_page , _comp_number_page - 1  ) , 
If( ThisItem.Value = 7 , Set( _comp_number_page , _comp_number_page + 1  ) ,
If( ThisItem.Value = 9 , Set( _comp_number_page , _comp_num_last_page  ) 
))))

;

Set(_comp_rows_to_subtract,Dropdown1_39.Selected.Value*(_comp_number_page-1)) ;

If( ThisItem.Value = 1 , 
    Set( _comp_number_page , 1  );
    Set( _col_paginated,
        FirstN(
            comp_table1_v01.Items_Table,
            Dropdown1_39.Selected.Value
        )
    );

 ,
// 현재 페이지 번호가 1이 아니라면 
If( ThisItem.Value = 3 && Text(_comp_number_page) <> "1" , 

    Set( _comp_number_page , _comp_number_page - 1  );
    Set( _col_paginated,
        LastN(
                FirstN(
                    comp_table1_v01.Items_Table,
                    Dropdown1_39.Selected.Value * _comp_number_page
                ),
                Dropdown1_39.Selected.Value
            )
    );
    , 
// 현재 페이지 번호와 마지막 페이지 번호가 다르면 현재 페이지 번호 + 1 
If( ThisItem.Value = 7 && Text(_comp_number_page) <> Text(_comp_num_last_page) ,

    Set( _comp_number_page , _comp_number_page + 1  );
    Set( _col_paginated,    
        LastN(
                FirstN(
                    comp_table1_v01.Items_Table,
                    Dropdown1_39.Selected.Value * _comp_number_page
                ),
                Dropdown1_39.Selected.Value
            )
        );
    ,

If( ThisItem.Value = 9 , Set( _comp_number_page , _comp_num_last_page  ) ;
    Set( _col_paginated,
        LastN(
                comp_table1_v01.Items_Table,
                CountRows(comp_table1_v01.Items_Table) - (Dropdown1_39.Selected.Value * (_comp_number_page - 1))
            )
    );
))))
;

Set(_comp_rows_to_subtract,Dropdown1_39.Selected.Value*(_comp_number_page-1)) ; 


Set(_col_paginated,
   ForAll(
        Sequence(
            CountRows(_col_paginated)
        ),
        Patch( 
            Last(
                FirstN(
                _col_paginated,
                Value)
            )
            ,
            {
                No:Text( If( _comp_number_page = 1 ,Value, (_comp_number_page-1)*Dropdown1_39.Selected.Value+Value) , "00")
            }
        )
    ) 
);

Set(
    _comp_number_page,
    1
);
Set(
    _comp_num_last_page,
    IfError(
        RoundUp(
            IfError(
            CountRows(comp_table1_v01.Items_Table) /Dropdown1_39.Selected.Value,0),
            0
        ),
        0
    )
) ; 

Set( _col_paginated,
        FirstN(
            comp_table1_v01.Items_Table,
            Dropdown1_39.Selected.Value
        )
);


Set(_col_paginated,
   ForAll(
        Sequence(
            CountRows(_col_paginated)
        ),
        Patch( 
            Last(
                FirstN(
                _col_paginated,
                Value)
            )
            ,
            {
                No:Text( If( _comp_number_page = 1 ,Value, (_comp_number_page-1)*Dropdown1_39.Selected.Value+Value) , "00")
            }
        )
    ) 
);

